import React from "react";
import Product from "./product.json";
import { Box } from "@chakra-ui/react";

const CartItems = () => {
  // const [products, setProducts] = React.useState([]);
  // console.log(Product);
  return (
    <>
      <Box>{Product.map((product, index) => {
        return <>
          <Box >
            {product.name}
          </Box>
        </>
      })}</Box>
    </>
  );
};

export default CartItems;
